import React, { Component } from 'react';
import {trendingMovies} from '../../src/actions'
import {connect} from 'react-redux'
import SingleMovie from './SingleMovie'
import './MovieList.scss'
class Trending extends Component {

 render(){
   return (
     <div className="trending_component"> 
        <div className='search_result'>
            { 
                this.props.movies.map(({id, ...otherprops}) => (
                      <SingleMovie    key={id} {...otherprops} />
                ))
            }
        </div>

     </div>
   );
 }
}
const mapStateToProps = state =>({
    trending:state.search.trending
})
export default connect(mapStateToProps, {trendingMovies})(Trending);
